import React from 'react';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

import './PostForm.css'

const PostForm = () => {
    return(
        <div>
            <h1>새 글 작성</h1>
            <h2>제목을 입력해주세요</h2>
            <input type='text'></input>
            <h2>내용을 입력해주세요</h2>
            <textarea name='content-new'></textarea>
        </div>
    )
}

export default PostForm;
